import React, { Component } from "react";
class ProgrammersCard extends Component {
  
  render(){
  const cardStyle = {
    backgroundColor: props.website ? "pink" : "white",
  };
  return (
    <div className="col">
      <div className="card shadow" style={cardStyle}>
        <div className="card-header">
          <img
            style={{ maxWidth: "100%" }}
            src={props.image}
            className="card-img-top "
            alt="error"
          />
        </div>

        <div className="card-body">
          <h5 className="card-title">{props.name}</h5>
          <p className="card-text">{props.jop}</p>
          <ul className="list-group list-group-flush">
            <li className="list-group-item">{`phone: ${props.phone}`}</li>
            <li className="list-group-item">{`email: ${props.email}`}</li>
            <li className="list-group-item">{`website: ${props.website}`}</li>
          </ul>
        </div>
      </div>
    </div>
  );}
}
export default ProgrammersCard;
